chrome.runtime.onInstalled.addListener(()=>{console.log("Accessibility Toolkit installed")});chrome.tabs.onActivated.addListener(t=>{chrome.storage.sync.get("settings",e=>{e.settings&&chrome.tabs.sendMessage(t.tabId,e.settings,()=>{chrome.runtime.lastError})})});chrome.tabs.onUpdated.addListener((t,e,r)=>{e.status==="complete"&&chrome.storage.sync.get("settings",s=>{s.settings&&chrome.tabs.sendMessage(t,s.settings,()=>{chrome.runtime.lastError})})});
